import { useEffect, useState } from "react";

const Numbers = ({ getNumber }) => {
  const [numbers, setNumber] = useState([]);
  useEffect(() => {
    setNumber(getNumber());
  }, [getNumber]);
  return (
    <div>
      {numbers.map((el) => (
        <p key={el}>{el}</p>
      ))}
    </div>
  );
};

